import logo from './logo.svg' ;
import './App.css';
import {BrowserRouter as Router,
  Switch,
  Link,
  Route, 
  NavLink} from 'react-router-dom'
import Discussion from './components/Discussion';

function App(){
  return (
    <div className="App">
      <Router>
        <ul>
          <li><NavLink to="/" activeClassName='App-ink'>Home</NavLink></li>
          <li><NavLink to="/discussion" activeClassName='App-Link'>Discussion</NavLink></li>
        </ul>
        <hr/>
        <Switch>
          <Route exact path = "/"><p>Home</p></Route>
          <Route path = "/discussion">
            <Discussion/>
          </Route>
        </Switch>
      </Router>
    </div>
  );
}
export default App;
